Here is a sample Spark job to calculate the hit rate for onsite attributed data:

```java
import org.apache.spark.api.java.JavaPairRDD;
import org.apache.spark.api.java.JavaRDD;
import org.apache.spark.api.java.function.Function;
import org.apache.spark.api.java.function.PairFunction;
import scala.Tuple2;

import java.sql.Timestamp;
import java.util.HashMap;
import java.util.Map;

public class HitRateCalculator {

    public static void main(String[] args) {
        // Create a SparkConf and SparkContext
        JavaSparkContext sc = new JavaSparkContext("local[*]", "HitRateCalculator");

        // Load onsite attributed data
        JavaRDD<String> onsiteAttributedData = sc.textFile("path/to/onsite_attributed_data.txt");
        JavaRDD<String> topFrequentQueries = sc.textFile("path/to/top_frequent_queries.txt");

        // Parse onsite attributed data into a JavaPairRDD of (query, timestamp)
        JavaPairRDD<String, Timestamp> onsiteAttributedDataPairRDD = onsiteAttributedData.mapToPair(new PairFunction<String, String, Timestamp>() {
            @Override
            public Tuple2<String, Timestamp> call(String line) {
                String[] fields = line.split(",");
                return new Tuple2<>(fields[0], new Timestamp(Long.parseLong(fields[1]) * 1000));
            }
        });

        // Parse top frequent queries into a HashMap for quick lookup
        Map<String, Long> topFrequentQueriesMap = new HashMap<>();
        topFrequentQueries.map(line -> line.split(",")[0]).foreach(query -> topFrequentQueriesMap.put(query, 1L));

        // Initialize cache and cache miss counters
        Map<String, Timestamp> cache = new HashMap<>();
        long cacheMissCount = 0;
        long cacheHitCount = 0;

        // Process onsite attributed data and calculate hit rate
        onsiteAttributedDataPairRDD.foreach(new Function<Tuple2<String, Timestamp>, Void>() {
            @Override
            public Void call(Tuple2<String, Timestamp> tuple) {
                String query = tuple._1();
                Timestamp timestamp = tuple._2();

                // Check if query is in cache and if it's a cache hit
                if (cache.containsKey(query) && cache.get(query).before(timestamp.getTime() - (12 * 60 * 60 * 1000))) {
                    cacheHitCount++;
                } else {
                    // Check if query is in top frequent queries and if it's a cache miss
                    if (topFrequentQueriesMap.containsKey(query)) {
                        cacheMissCount++;
                        // Cache the query and update its timestamp
                        cache.put(query, timestamp);
                    }
                }
            }
        });

        // Calculate hit rate
        double hitRate = (double) cacheHitCount / (double) (cacheHitCount + cacheMissCount);
        System.out.println("Hit Rate: " + hitRate);

        // Stop the SparkContext
        sc.stop();
    }
}
```

This job reads the onsite attributed data and top frequent queries from files, parses them into appropriate data structures, and calculates the hit rate based on the cache and cache miss counters. The hit rate is the ratio of cache hits to the total number of requests (cache hits + cache misses). The cache is cleared every 12 hours for each query.

